import ActionTypes from './actionTypes';




export const addTodo = (todo) =>(dispatch) => {
    return dispatch({
          type: ActionTypes.ADD_TODO,
          payload: todo
    });
};


export const toggleTodo=(id)=>({
    type: ActionTypes.TOGGLE_TODO,
    payload:id
});
